import './Layout.css'
import NavBar from "../NavBar/NavBar";

const Layout = ({children}) => {

    return (
        <div className='Layout'>
            <header>
                <NavBar color='black'/>

            </header>
            <main>
                {children}
            </main>
            <footer>
                Copyright {new Date().getFullYear()}
            </footer>
        </div>
    );
}

export default Layout;
